import React from 'react';

import ReactDOM from 'react-dom';


const element = <div className="row">

    <div className="pane col-lg col-md-12 text-center" id="weatherCol">
        {/* <h1>{{temp}}<span>&#176;</span> </h1> */}


        <span className="hidden" id="CloudsIcon"><i className="fas fa-cloud fa-7x"></i></span>
        <span className="hidden" id="ClearIcon"><i className="fas fa-sun fa-7x"></i></span>
        <span className="hidden" id="RainIcon"><i className="fas fa-cloud-rain-7x"></i></span>

        {/* <h2>{{status}}</h2> */}
        <small>At home</small>
    </div>
    <div className="pane col-lg col-md-12 text-center" id="statusCol">
        <h4>MOTHERBASE//STATUS</h4>
        <i className="fas fa-hdd fa-7x"></i>
        {/* <h4>{{grandFree}} GB free</h4> */}

    </div>
    </div>;

ReactDOM.render(element, document.getElementById('pane'));
